import React, { useContext } from "react";
import "./Home.css";
import Header from "../Header/Header";
import MangasList from "../MangaList/MangasList";
import { MangaContext } from "../MangaCont";
import { MangaProvider } from "./components/MangaCont";

const Home = () => {
  const value = useContext(MangaContext);
  return (
    <MangaProvider>
      <div>
        <h1>{value}</h1>
      </div>
    </MangaProvider>
  );
};

export default Home;
